import React, { useState, useEffect } from 'react';
import {
  Dialog, DialogTitle, DialogContent, DialogActions,
  TextField, Button, Grid, Checkbox, FormControlLabel
} from '@mui/material';
import { uploadTestResults } from './api';

const CIRCUIT_ID_REGEX = /^[A-Z]{6}[0-9]{6}$/;

const defaultValues = {
  circuit_id: '',
  outage_tickets_last_30d: '',
  maintenance_tickets_last_30d: '',
  kmz_file_path: '',
  live_latency: '',
  expected_latency: '',
  test_results_link: '',
  cable_system: '',
  is_special: false,
  underlying_carrier: '',
  location_a: '',
  location_b: '',
  bandwidth: '',
  more_details: ''
};

function RouteFormDialog({ open, onClose, onSubmit, initialValues = {}, isEdit = false }) {
  const [values, setValues] = useState({ ...defaultValues, ...initialValues });
  const [file, setFile] = useState(null);
  const [testResultsFile, setTestResultsFile] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    setValues({ ...defaultValues, ...initialValues });
    setFile(null);
    setTestResultsFile(null);
    setError('');
  }, [open, initialValues]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setValues(v => ({ ...v, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleTestResultsFileChange = (e) => {
    setTestResultsFile(e.target.files[0]);
  };

  const handleSubmit = () => {
    if (!isEdit && !CIRCUIT_ID_REGEX.test(values.circuit_id)) {
      setError('Circuit ID must be 6 uppercase letters followed by 6 digits');
      return;
    }
    setError('');
    onSubmit({ ...values }, file, testResultsFile);
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>{isEdit ? 'Edit' : 'Add'} Network Route</DialogTitle>
      <DialogContent>
        <Grid container spacing={2} sx={{ mt: 1 }}>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Circuit ID (UCN)"
              name="circuit_id"
              value={values.circuit_id}
              onChange={handleChange}
              fullWidth
              required
              disabled={isEdit}
              error={!!error}
              helperText={isEdit ? '' : error}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Outage Tickets (30d)"
              name="outage_tickets_last_30d"
              value={values.outage_tickets_last_30d}
              onChange={handleChange}
              type="number"
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Maintenance Tickets (30d)"
              name="maintenance_tickets_last_30d"
              value={values.maintenance_tickets_last_30d}
              onChange={handleChange}
              type="number"
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Button variant="outlined" component="label" fullWidth>
              {file ? file.name : (values.kmz_file_path ? values.kmz_file_path : 'Upload KMZ File')}
              <input type="file" accept=".kmz" hidden onChange={handleFileChange} />
            </Button>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Button variant="outlined" component="label" fullWidth>
              {testResultsFile ? testResultsFile.name : (values.test_results_file ? values.test_results_file : 'Upload Test Results File')}
              <input type="file" hidden onChange={handleTestResultsFileChange} />
            </Button>
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Live Latency"
              name="live_latency"
              value={values.live_latency}
              onChange={handleChange}
              type="number"
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Expected Latency"
              name="expected_latency"
              value={values.expected_latency}
              onChange={handleChange}
              type="number"
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Test Results Link"
              name="test_results_link"
              value={values.test_results_link}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Cable System"
              name="cable_system"
              value={values.cable_system}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <FormControlLabel
              control={<Checkbox checked={!!values.is_special} onChange={handleChange} name="is_special" />}
              label="Special/ULL"
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Underlying Carrier"
              name="underlying_carrier"
              value={values.underlying_carrier}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Location A"
              name="location_a"
              value={values.location_a}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Location B"
              name="location_b"
              value={values.location_b}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <TextField
              label="Bandwidth"
              name="bandwidth"
              value={values.bandwidth}
              onChange={handleChange}
              fullWidth
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              label="More Details"
              name="more_details"
              value={values.more_details}
              onChange={handleChange}
              fullWidth
              multiline
              minRows={2}
            />
          </Grid>
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={handleSubmit} variant="contained">{isEdit ? 'Save' : 'Add'}</Button>
      </DialogActions>
    </Dialog>
  );
}

export default RouteFormDialog;
